import React from 'react'
import ReactDOM from 'react-dom'
import useReactRouter from 'use-react-router';
import { NextButton } from '../components/atoms/buttons';
import customButton from '../components/atoms/customButton.module.css';
import { Typography, makeStyles, Grid, Box, Button } from '@material-ui/core'
const Frame = require('../assets/decorativeframe.png');

const useStyles = makeStyles({
    startText: {
        borderBottom:"1px solid #4575B4",
        backgroundColor: "#EFEDE9",
        fontSize:"25px",
        color: "#4575B4",
        width: "50%",
        height: "5%",
        marginTop: "-35%",
        marginLeft: "25%",
        zIndex: 2,
        position: 'absolute',
        letterSpacing:"6px",
        fontFamily: "Hira Min Pro",
        textAlign:"center",
        lineHeight:"50px",
        paddingBottom:"1px",
    },
    frameDesign: {
        zIndex: 1,
        width: "90%",
        height: "85%",
        display: 'flex',
        alignItems: 'top',//縦
        marginTop: "10%",
        justifyContent: 'center',
        marginLeft: '3%',
        padding: 10,
    }
})

const WelcomePage: React.FC = () => {
    const classes = useStyles()
    const title = "選択式ミステリー旅行"
    const { history } = useReactRouter();
    return (
        <div>
            {/* {title} */}
            {/* <button className={customButton.selectButton} onClick={() => history.push('/map')}>map</button> */}
            <div>
                <img src={Frame} className={classes.frameDesign} />
                <a className={classes.startText} onClick={() => history.push('/login')}>いますぐ始める→</a>
            </div>
        </div>
    )
}

export default WelcomePage;
